        public static async Task<List<ImageFile>> FetchAllImageList(string inDirectoryName)
        {
            // The URL to connect to, in order to fetch our images
            string FetchURL = string.Format(ClodinaryAPILink_ImageList, CLOUDINARY_CLOUDNAME);

            // Creates the HTTPClient object
            var handler = new HttpClientHandler();
            var req = new HttpClient(handler);

            // Setting request header property
            req.DefaultRequestHeaders.CacheControl = new System.Net.Http.Headers.CacheControlHeaderValue();
            req.DefaultRequestHeaders.CacheControl.NoCache = true;
            req.DefaultRequestHeaders.Authorization =
                new System.Net.Http.Headers.AuthenticationHeaderValue("Basic",
                Base64Encoder.Base64Encode(string.Format("{0}:{1}", CLOUDINARY_APIKEY, CLOUDINARY_SECRETKEY)));

            handler.AutomaticDecompression = DecompressionMethods.Deflate | DecompressionMethods.GZip;
            // http://stackoverflow.com/questions/19473996/get-count-of-array-that-converted-to-dynamic-in-c-sharp

            try
            {
                HttpResponseMessage data = await req.GetAsync(FetchURL);
                HttpContent content = data.Content;
                data.EnsureSuccessStatusCode();

                string result = await content.ReadAsStringAsync();
                dynamic jsonResponse = JsonConvert.DeserializeObject(result);
								// Create an empty return array
								List<ImageFile> imageList = new List<ImageFile>();
								int numOfImages = 0;
                // Loop through the JSON array
                foreach (dynamic image in jsonResponse)
                {
										numOfImages= ObtainNumOfElementsInDynamicCollection(image.Value);
                    //images.Add(ParseUploadedImageInternal(image));
                    for (int index = 0; index < numOfImages; index++)
                    {
                        dynamic oneImage = image.Value[index];
                        imageList.Add(ParseUploadedImageInternal(oneImage));
                    }
                }
								//The return type is List<ImageFile>. Therefore, I must remember to use the ToList() method.
                return imageList.Where(eachElement=>eachElement.PublicId.Contains(inDirectoryName)).ToList<ImageFile>();
            }
            catch (Exception ex)
            {
                Debug.WriteLine(ex.ToString());
            }
            return null;
        }

